function convertUrlsToString(urls, prefix) {
    return urls.map(obj => obj.url.replace(new RegExp(`.*${prefix}`), prefix)).join(',');
}



// 获取天气
async function weather(code) {
    const img = {
        '晴': 'data:image/png;base64,', // 晴
        '多云': 'data:image/png;base64,', // 多云
        '阴': 'data:image/png;base64,',  // 阴
        '阵雨': 'data:image/png;base64,', //
        '雷阵雨': 'data:image/png;base64,', // 雷阵雨
        '雨夹雪': 'data:image/png;base64,', // 雨夹雪
        '小雨': 'data:image/png;base64,', // 小雨
        '中雨': 'data:image/png;base64,', // 中雨
        '大雨': 'data:image/png;base64,', // 大雨
        '暴雨': 'data:image/png;base64,', // 暴雨
        '小雪': 'data:image/png;base64,', // 小雪
        '中雪': 'data:image/png;base64,', // 中雪
        '大雪': 'data:image/png;base64,', // 大雪
        '暴雪': 'data:image/png;base64,', // 暴雪
        '雾': 'data:image/png;base64,', // 雾
        '沙尘暴': 'data:image/png;base64,', // 沙尘暴
        '浮尘': 'data:image/png;base64,', // 浮尘
        '扬沙': 'data:image/png;base64,', // 扬沙
        '强沙尘暴': 'data:image/png;base64,', // 强沙尘暴
    }
    return await fetch(`https://restapi.amap.com/v3/weather/weatherInfo?city=${code}&key=5566078add3802ac7d7251c5342d7e28`)
        .then((res) => res.json())
        .then((res) => {
            const obj = res?.lives[0];
            // 如果对应的图片存在，直接返回
            if (img[obj.weather]) {
                obj.icon = img[obj.weather]
                return obj
            }

            if (obj.weather.includes('晴')) {
                obj.icon = img['晴']
                return obj
            }
            if (obj.weather.includes('雨')) {
                obj.icon = img['小雨']
                return obj
            }
            if (obj.weather.includes('雪')) {
                obj.icon = img['小雪']
                return obj
            }
            if (obj.weather.includes('尘')) {
                obj.icon = img['浮尘']
                return obj
            }
            return obj;
        });
}




export {
    convertUrlsToString,
    weather
}
